import React from 'react';
import { Link, Outlet } from 'react-router-dom';

function Page() {
  return (
    <>
      <div className='navbar'>
        <div className='logo'>
          ayako
        </div>
        <div className='navigation'>
          <ul>
            <li>
              <Link to='collections/new-arrivals' >New Arrivals</Link>
            </li>
          </ul>
        </div>
        <div>{Outlet}</div>
      </div>

    </>
  );
}

export default Page;
